import React from 'react';
import { Link } from 'react-router-dom';
import './style.css';

function Navbar() {
    return (
        <nav class="navbar navbar-light bg-light">
            <Link className="navbar-brand" to="/home">Comics!</Link>
        </nav>
    )
}

export default Navbar
